  selector: 'app-root',
  standalone: true,
  imports: [ RouterOutlet, MatIcon ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})

export class AppComponent implements OnInit {
  ngOnInit() {
  }
}
<div class="grid place-items-center h-screen bg-amber-200">
